const ADD_POST = 'ADD_POST';
export const addPost = () => {
  return {
    type: ADD_POST,
  }
}

const dummyPost = {
    id: 2,
    content: '더미',
    user: {
        id: 1,
        nickname: '제로초',
    },
    images: [],
    comments: [],
};

// (이전상태, 액션) => 다음상태
const reducer = (state = initialState, action) => {
    switch (action.type) {
        case ADD_POST:
            return {
                ...state,
                mainPosts: [dummyPost, ...state.mainPosts],
                postAdded: true,
            }
        default:
          return state;  
  
    };
};

export default reducer;